import { connect } from "react-redux";
import axios from "axios";
import React from "react";
import getLangs from "../../actions/langs"
const Cities = ({ lang_result,filter }) => {
  //console.log(lang_result);
  useEffect(()=>{
    getLangs(filter);
      },[]);

      return <div>{lang_result.items}</div>
  const renderlangresult = lang_result.map((item, i) => {
    return (
      <li key={i}>
        item.full_name
      </li>
    );
  });
  return <ul>{renderlangresult}</ul>;
};


const mapStateToProps = state => ({
  lang_result: state.lang,
  filter:state.visibilityFilter
});

export default connect(mapStateToProps)(Cities);
